IF OBJECT_ID('dbo.proc_transform_465', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_465;
GO
CREATE PROCEDURE dbo.proc_transform_465
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_465
    SET payload = LEFT(payload, 1000) + N'|V4-465|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_465;
END
GO
IF OBJECT_ID('dbo.audit_v4_465', 'U') IS NULL
